import React, { useState } from 'react';
import '.st/Navbar.css'; // You can create a separate CSS file for styling

const Navbar = () => {
  const [isMenuOpen, setMenuOpen] = useState(false);

  const toggleMenuOpen = () => {
    setMenuOpen(!isMenuOpen);
  };

  return (
    <nav className={`navbar ${isMenuOpen ? 'open' : ''}`}>
      <div className="navbar-overlay" onClick={toggleMenuOpen}></div>

      <button type="button" className="navbar-burger" onClick={toggleMenuOpen}>
        <span className="material-icons">menu</span>
      </button>

      <h1 className="navbar-title">AsmrProg</h1>

      <nav className="navbar-menu">
        <button type="button" className="active">
          Youtube
        </button>
        <button type="button" className="active">
          Archive
        </button>
        <button type="button">Projects</button>
      </nav>
    </nav>
  );
};

export default Navbar;
